import "./App.css";
import Navbar from "./components/navbar.js";
import Home from "./pages/home.js"; 
import Services from "./pages/services.js";
import About from "./pages/about.js";
import Contact from "./pages/contact.js";
import Interior from "./pages/interior.js";
import ArchitectPlan from "./pages/architectPlan.js";
import HouseDetails from "./pages/houseDetails.js";
import Footer from "./components/footer.js";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <Routes>
          <Route exact path="/" element={<Home />} />
          <Route exact path="/services" element={<Services />} />
          <Route exact path="/about" element={<About />} />
          <Route exact path="/contact" element={<Contact />} />
          <Route exact path="/interior" element={<Interior />} />
          <Route exact path="/architectPlan" element={<ArchitectPlan />} />
          <Route path="/houseDetails/:index" element={<HouseDetails />} />
          </Routes>

        <Footer />
      </div>
    </Router>
  );
}

export default App;
